a lot of you have been asking about backup accounts since i was banned. i have two! my favorite one is @climatebriefings where i talk about working on finishing my masters degree in climate science this year and moving onto my phd in climate research next year. so far i have been in a project with the united nation’s ipcc as an expert reviewer on their srocc report due out next year! here’s a look!
#repost @climatebriefings
・・・
weather does not equal climate. a warming climate will cause the jet stream to meander more greatly causing the polar vortex to reach lower latitudes. temperatures around the world will not rise uniformly. last year temperatures in the arctic were over 7 degrees celsius above average while global average temperatures were only 1.1 degrees celsius above average. ❄️🌎✊❤️
*
*
*
@climatebriefings
@climatebriefings 
@climatebriefings

