text:
the process between me and the brave survivors who share here is different every time. sometimes it’s a quick back and forth; others become conversations that last long after i’ve published their story. sometimes i preserve their words exactly as written; others seek more active editing or creative transformation. this time, as i began to read, i could feel the cadence of the cycle of self-blame, of questioning, of abject fear, of determination, over and over again. i heard that inner voice, caught the tone shift from narration to something more internal. so we decided to make that part of the story. and i want her to know: i see you, i hear you, and i believe you. read her story at the link in my profile, then drop a comment below and let her know you’re with her, too.
✒🖤
@thewordforthis

